        <ChakraProvider>
            <Box backgroundColor='black'>
                
                <Box color='white' fontSize='50px' borderRadius='20px' width='100%' paddingLeft='20%' fontFamily='fantasy'>
                    <h1>Dio Bank</h1>

                </Box>
        
            </Box>
        </ChakraProvider>

    )
}
